/*Table structure for table `establishment` */

DROP TABLE IF EXISTS `establishment`;

CREATE TABLE `establishment` (
  `username` varchar(200) default NULL,
  `password` varchar(200) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `establishment` */

insert  into `establishment`(`username`,`password`) values ('Establishment','Establishment');

/*Table structure for table `letter` */

DROP TABLE IF EXISTS `letter`;

CREATE TABLE `letter` (
  `id` int(11) NOT NULL auto_increment,
  `email` varchar(1000) default NULL,
  `pemail` varchar(1000) default NULL,letterinformation_schema
  `dept` varchar(1000) default NULL,
  `name` varchar(1000) default NULL,
  `equipment` varchar(1000) default NULL,
  `amount` varchar(1000) default NULL,
  `image` longblob,
  `status` varchar(1000) default NULL,
  `establish` varchar(1000) default NULL,
  `registrar` varchar(1000) default NULL,
  PRIMARY KEY  (`id`)
